import React from "react";
import "./Header.css";
function Header(){
    return(
        <div>
            <div className="h1">
                <h1>LearnCode</h1>
            </div> 
            <div>
                <button className="compiler">Compiler</button>
                <button className="signin">SignIn</button>
                <button className="signout">SignOut</button>
            </div>          
        </div>

    );
}
export default Header;
